import React from 'react'
import Cart from '../components/Cart'
import Summary from '../components/Summary'
function Bill() {
  return (
    <div className='grid grid-cols-2 w-10/12  py-6 mx-auto '>
       <Cart/>
       <Summary/>
    </div>
  )
}

export default Bill
